import React, { useState } from "react";
import classes from '../components/Card.module.css';
import Card from "./Card";

const ListPeople =(props)=>{

  const [peopleDelete, setPeopleDelete] = useState([]);
  async function fetchPeopleHandlerDelete() {
     const response = await fetch('https://jsonplaceholder.typicode.com/users');
       const data = await response.json();
         console.log(data);
           const transformedPeople = data.map(PeopleData => {
             return {
               id: PeopleData.id,
               name: PeopleData.name,
               username: PeopleData.username,
               email: PeopleData.email,
               };
           });
           setPeopleDelete(transformedPeople); 
     }; 

return(
  <Card>
    <li className={classes.card2}>
      <h2>{props.name}</h2>
      <h3>{props.username}</h3>
      <p>{props.email}</p>
      <button onClick={fetchPeopleHandlerDelete}>Delete</button>
      </li>
    </Card>
);
};
export default ListPeople;
